pragma solidity >=0.4.22 <0.9.0;

contract MyToken {
    mapping(address => uint) public _totalSupply;
    mapping(address => mapping(address => uint)) public _allowance;
    address public _owner;
    address public _newOwner;
    uint256 public __totalSupply;
    uint256 public _decimals;
    string public _name;
    string public _symbol;

    event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
    event Transfer(address indexed from, address indexed to, uint tokens);
    event OwnershipTransferred(address indexed from, address indexed to);

    constructor() public {
        _owner = msg.sender;
        _decimals = 18;
        __totalSupply = 1000000 * 10**18; // 1 million tokens
        _name = "MyToken";
        _symbol = "MTK";
    }

    function totalSupply() public view returns (uint) {
        return __totalSupply - _totalSupply[address(0)];
    }

    function balanceOf(address tokenOwner) public view returns (uint balance) {
        return _totalSupply[tokenOwner];
    }

    function allowance(address tokenOwner, address spender) public view returns (uint remaining) {
        return _allowance[tokenOwner][spender];
    }

    function approve(address spender, uint tokens) public returns (bool success) {
        _allowance[msg.sender][spender] = tokens;
        emit Approval(msg.sender, spender, tokens);
        return true;
    }

    function transfer(address to, uint tokens) public returns (bool success) {
        require(_totalSupply[msg.sender] >= tokens);
        _totalSupply[msg.sender] -= tokens;
        _totalSupply[to] += tokens;
        emit Transfer(msg.sender, to, tokens);
        return true;
    }

    function transferFrom(address from, address to, uint tokens) public returns (bool success) {
        require(tokens <= _totalSupply[from]);
        require(tokens <= _allowance[from][msg.sender]);
        _totalSupply[from] -= tokens;
        _totalSupply[to] += tokens;
        _allowance[from][msg.sender] -= tokens;
        emit Transfer(from, to, tokens);
        return true;
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == _owner);
        _newOwner = newOwner;
    }

    function acceptOwnership() public {
        require(msg.sender == _newOwner);
        emit OwnershipTransferred(_owner, _newOwner);
        _owner = _newOwner;
        _newOwner = address(0);
    }
}
